import React,{Component} from "react";
import axios from 'axios';
import {Table} from "reactstrap";


export default class EMPL_LIST extends Component{
    constructor(props) {
        super(props);
        this.state={jsondata:[]}
        this.componentDidMount = this.componentDidMount.bind(this)
    }
    componentDidMount() {
        axios.get('https://jsonplaceholder.typicode.com/users')
            .then(response=> {
               this.setState({jsondata:response.data})
                console.log(response);
            })
            .catch(function (error) {
                alert("BAD REQUEST")
            });
    }
    render(){
        return(
            <div className="container bg-faded m-lg-3">
              <Table hover>
                  <thead>
                        <th>Employee ID</th>
                        <th>Employee Name</th>
                        <th>Employee E-mail</th>
                        <th>Employee Username</th>
                  </thead>
                  <tbody>
                        {this.state.jsondata.map(emplid=>(
                            <tr >
                                <td key = {emplid}>{emplid.id}</td>
                                <td key = {emplid}>{emplid.name}</td>
                                <td key = {emplid}>{emplid.email}</td>
                                <td key = {emplid}>{emplid.username}</td>
                            </tr>
                        ))}
                  </tbody>
              </Table>
            </div>
        )
    }
}
